import React from "react";
import SideIcons from "./SideIcons";


function NavBar() {
    return <div style={{ width: '25%', paddingTop: '20px' }}>


        <h1 className="NavBarHeader">Ashhab</h1>

        <SideIcons name="About" />
        <SideIcons name="Skills" />
        <SideIcons name="Experience" />
        <SideIcons name="Projects" />
        <SideIcons name="Contact" />
    </div>
}

export default NavBar;
